import React from 'react'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Boxoffice from './component/Basics/Boxoffice';
import Register from './component/Basics/Register';
import {BrowserRouter as Router,Route} from 'react-router-dom'


const App = () => {

  return (
    <div className="App">
      <Router>

            <Route path="/" element={<Boxoffice/>}>
            </Route>
            <Route path="/Register" element={<Register/>}>
            </Route>
          </Router>

      <Boxoffice/>


    </div>
  )}

export default App;
